import React from 'react';

const Categories = () => {
  const [] = React.useState();

  return (
    <div className="categories">
      <ul>
        <li className="active">Усі</li>
        <li>М'ясні</li>
        <li>Вегетаріанські</li>
        <li>Гриль</li>
        <li>Гострі</li>
        <li>Закриті</li>
      </ul>
    </div>
  );
};

export default Categories;
